      creators: [{
        affiliation: 'Oxford Institute for Energy Studies, Oxford, United Kingdom',
        name: 'Stern, Jonathan'
      }],
      description: "<p>The\xA0role of gases in the\xA0energy transition is a\xA0different, and much more immediate, issue in the\xA0EU, compared with other global regions. Net zero targets for 2050 mean that in order to retain the\xA0gas market and the\xA0extensive network infrastructure which has been developed, zero carbon gases will need to be developed, and natural gas (methane) will need to be decarbonized. Maximum availability of biomethane and hydrogen from power to gas is estimated at 100\u2013150 billion cubic meters by 2050 (or around 25\u201330% of gas demand in the\xA0late 2010s. Therefore, large scale hydrogen production from reforming methane with carbon capture and storage (CCS), or pyrolysis, will be needed to maintain anything close to current demand levels. Costs of biomethane and hydrogen options are several times higher than prices of natural gas in 2019\u20132020. Significant financial support for decarbonization technologies \u2014 from governments and regulators \u2014 will therefore be needed in the\xA02020s, if they are to be available on a\xA0large scale in the\xA02030s and 2040s. If the\xA0EU gas community fails to advance convincing decarbonized narratives backed by investments which allow for commercialization of renewable gas and methane decarbonization technologies; and/or governments fail to create the\xA0necessary legal/fiscal and regulatory frameworks to support these technologies, then energy markets will progressively move away from gases and towards electrification. </p>",
