      access_right_category: 'success',
      creators: [{
        affiliation: 'German Institute for International and Security Affairs, Berlin, Germany',
        name: 'Westphal, Kirsten'
      }],
      description: "<p>Russia is the\xA0world's largest gas exporter and Germany is its most important market. Moreover, natural gas is a\xA0centerpiece of the\xA0Russian economy and the\xA0backbone of its energy supply to the\xA0Russian population. In terms of its external gas relations, Germany has always kept a\xA0special and strategic position, both in terms of volumes, but also in substance. This contribution explores the\xA0impact of the\xA0energy transition on the\xA0bilateral gas relationship. It argues that the\xA0bilateral gas relationship has been subjected to various paradigm shifts in the\xA0past, but, until recently, the\xA0relationship has been seen as in line with the\xA0strategic energy triangle of climate change/sustainability, supply security and economic competitiveness. This perception has come into question over two issues: climate change and supply security. Moreover, Germany's authority over the\xA0conduct and the\xA0legal framework of bilateral gas relations has been increasingly contested, by Brussels, but also horizontally by other EU member states. At this stage, it is very uncertain whether both sides will manage to maintain and redefine their close energy partnership to address climate change. Decarbonizing the\xA0gas value chain would be a\xA0centerpiece. This would require a\xA0political shift away from securitization to decarbonization, not only in Germany, but even more so in the\xA0EU, and in particular, in Russia. </p>",
