      creators: [{
        name: 'Jackson, John'
      }, {
        name: 'Lee, Bryan'
      }],
      description: '<p>The zero emission bus industry has experienced rapid growth. However, there is limited data on the growth and deployment of zero-emission buses across the United States. While transit buses in general have been counted by the Federal Transit Administration and organizations like American Public Transportation Association, the separation of ZEBs in these counts are limited and there have been few systemic counts of zero emission buses in American fleets. Since ZEBs are still considered a new technology this information has been deemed difficult to find. Through extensive research by looking at a variety of funding sources and their allocation, outreach to transit agencies and OEM&rsquo;s, and analysis of media reports, this information can be obtained in order to give a round house projection. These numbers are important to track due to the priority that many states across the country have placed on transitioning to zero emission buses over the course of the next few decades. Tracking these numbers also highlights which regions are making significant advances in deployments and which ones are lagging. This information can be used to address systemic challenges in deploying buses and their infrastructure.</p>\n\n<p>Understanding the technological development needs of these buses is also very important. While the number of ZEBs have grown by 37 percent in the last year, these buses have still encountered some technological challenges while they continue to be deployed. Aspects such as heating, ventilation, and air conditioning affect the efficiency and performance of these vehicles. Buses also need to reduce energy consumption and maximize the amount of onboard energy that can be stored to improve their performance. While these challenges can seem like a roadblock in the success of these vehicles, technological solutions are being developed in order to counteract these problems.</p>',
